Anna, Bob, and her grandparents are on vacation to visit some of the most wonderful places around the world. On their first stop, they learn about a farming contest featuring great prizes. Little do the organizers know that farming runs in Anna's blood, and now she and her friends are off to prove that they can be the best anywhere.

Travel to Australia, Egypt and China, looking after rare animals and taking care of exotic plants. Help Anna grow pineapples and cacao beans, breed camels and ostriches, make tequila and sushi, to win the first prizes in 59 challenging levels. Learn new skills at school, buy advanced equipment, and keep upgrading your farms to win these fabulous competitions. With two play modes, Hidden Object mini-games, colorful characters, and wonderful rewards, this can be the greatest vacation ever.
